INSERT INTO `faqs` VALUES (1,1,'Apa yang dimaksud dengan Informasi Publik ?','apa-yang-dimaksud-dengan-informasi-publik-11350','<p>Informasi Publik adalah informasi yang dihasilkan, disimpan, dikelola, dikirim, dan/atau diterima oleh suatu Badan Publik yang berkaitan dengan penyelenggara dan penyelenggaraan negara dan/atau penyelenggara dan penyelenggaraan Badan Publik lainnya yang sesuai dengan Undang-Undang No. 14 Tahun 2008 tentang Keterbukaan Informasi Publik serta informasi lain yang berkaitan dengan kepentingan publik.</p>',1,0,'2023-04-09 02:49:48','2023-04-09 02:49:48'),(2,1,'Apakah Tugas dan Fungsi Direktorat Jenderal SDA?','apakah-tugas-dan-fungsi-direktorat-jenderal-sda-22124','<p>Anda dapat membacanya di <a href=\"https://sda.pu.go.id/profil/tugas_fungsi\">sini</a></p>',1,1,'2023-04-09 02:50:25','2023-04-09 02:50:25'),(3,1,'Apakah seluruh Informasi Publik adalah informasi yang dapat diakses oleh Publik ?','apakah-seluruh-informasi-publik-adalah-informasi-yang-dapat-diakses-oleh-publik-54374','<p>Ya. Seluruh Informasi Publik dapat diakases oleh masyarakat, kecuali informasi yang dikecualikan/rahasia.<br>Anda dapat memperolehnya melalui Layanan Informasi Publik di<a href=\"https://pelayananpublik.pu.go.id/\">sini</a></p>',1,2,'2023-04-09 02:50:53','2023-04-09 02:50:53');
/*!40000 ALTER TABLE `faqs` ENABLE KEYS */;
