INSERT INTO `galleries` VALUES (8,2,'image','Bersih Sungai Hari Air Dunia 2023','foto1-05018','foto1_1681269409.JPG','Dalam Rangka Memperingati Hari Air Dunia Pada Jumat, 17 Maret 2023 BWS KALIMANTAN II melaksanakan bersih sungai pada  Drainase Kota yang ada di jalan Bukit Keminting Kota Palangka Raya yang di ikuti oleh BPPW, BPJN, BP2JK, IPU (Ikatan Pensiunan Pekerjaan Umum), Komunitas Peduli Sungai dan Lingkungan Universitas Muhammadyah Palangka Raya serta Pemerintah Daerah terkait.',NULL,'2023-04-11 20:16:49','2023-11-01 16:08:48'),(9,2,'image','Character Building BWS Kalimantan II','foto2-72910','foto2_1681269428.JPG','Character Building merupakan suatu upaya untuk membangun dan membentuk akhlak dan budi pekerti seseorang menjadi baik, terutama dalam lingkungan pekerjaan di lingkungan kantor BWS Kalimantan II Palangkaraya.\r\n\r\nSampit, Ujung Pandaran\r\n18-19 Januari 2023',NULL,'2023-04-11 20:17:09','2023-11-01 16:07:23'),(11,2,'image','Pembangunan Drainase Utama Pengendalian Banjir','pembangunan-drainase-utama-pengendalian-banjir-56519','pembangunan_drainase_utama_pengendalian_banjir_1681269481.PNG',NULL,NULL,'2023-04-11 20:18:01','2023-04-11 20:18:01'),(12,2,'image','Dokumentasi Infrastruktur SDA di DIR. Dadahup','rumah-jaga-dan-fasilitas-umum-lokasi-pintu-l-spu-89013','dokumentasi_infrastruktur_sda_di_dir_dadahup_1698826414.jpeg',NULL,NULL,'2023-04-11 20:18:33','2023-11-01 16:13:34'),(13,2,'video','Kegiatan DITJEN SDA PUPR Pada Lokasi Food Estate Provinsi Kalimantan Tengah TA. 2022','kegiatan-ditjen-sda-pupr-pada-lokasi-food-estate-provinsi-kalimantan-tengah-91276','ln2Gt0LYqWU',NULL,NULL,'2023-04-11 20:22:40','2023-04-11 20:24:55'),(15,2,'video','Character Building BWS Kalimantan II','character-building-bws-kalimantan-ii-23523','p_Cf00GlM5k',NULL,NULL,'2023-04-11 20:25:58','2023-04-11 20:25:58'),(16,2,'video','Alur Informasi dan Pelaporan Sektretariat Pos Bencana BWS Kalimantan II Palangka Raya','alur-informasi-dan-pelaporan-sektretariat-pos-bencana-bws-kalimantan-ii-palangka-raya-87838','kpdryDnbG64',NULL,NULL,'2023-04-11 20:26:59','2023-04-11 20:26:59'),(21,5,'video','Antisipasi El Nino dengan Pembangunan Sumur Bor oleh BWS Kalimantan II di Provinsi Kalimantan Tengah','antisipasi-bencana-kekeringan-melalui-upi-bws-kalimantan-ii-di-provinsi-kalimantan-tengah-tahun-2023-34051','_1mL8u953Pc','BWS Kalimantan II Palangkaraya melakukan pembangunan sumur bor di DS. Tumbang Lampahung Kec Kurun Kab. Gunung Mas Kalimantan Tengah untuk menghadapi musim kemarau ekstrim atau El Nino',NULL,'2023-08-28 13:57:16','2023-08-28 13:58:05'),(22,5,'video','Antisipasi Bencana Kekeringan melalui UPI BWS Kalimantan II di Provinsi Kalimantan Tengah Tahun 2023','antisipasi-bencana-kekeringan-melalui-upi-bws-kalimantan-ii-di-provinsi-kalimantan-tengah-tahun-2023-55932','i9RN5IrYQC8','Halo #Pahari Kota C4ntik…\r\n\r\nPada tahun 2023 ini dimulai dari bulan Juni dan puncaknya di bulan Agustus, Indonesia bersiap \r\nmenghadapi dampak fenomena El Nino. \r\n\r\nMengutip laman resmi Badan Meteorologi, \r\nKlimatologi, dan Geofisika (BMKG), El Nino adalah fenomena pemanasan Suhu Muka Laut \r\n(SML) di atas kondisi normalnya yang terjadi di Samudera Pasifik bagian tengah. Pemanasan \r\nSML ini meningkatkan potensi pertumbuhan awan di Samudera Pasifik tengah dan mengurangi curah hujan di wilayah Indonesia.\r\n\r\nDalam hal kesiapan menghadapi musim kekeringan akibat adanya fenomena El Nino, pihak BWS Kalimantan II Palangkaraya melalui Unit Pengelola Irigasi (UPI) Food Estate Kapuas \r\nBlok A telah melaksanakan beberapa hal, berupa :\r\n1. Mitigasi untuk Pertanian Berupa Alokasi Air untuk Ketahanan Pangan\r\n2. Mitigasi Bencana Kebakaran Hutan dan Lahan\r\n\r\nKami Beraksi\r\nSemangat Tinggi\r\nUntuk Kemajuan Petani\r\nUPI FOOD ESTATE KAPUAS BLOK A JAYA JAYA JAYA!\r\n\r\nFacebook : Pupr Sda Bws Kalimantan II\r\nTwitter : @Purp_sda_bwsk2\r\nInstagram : @Pupr_Sda_Kalimantan2\r\nYoutube : @Pupr_Sda_Kalimantan2\r\n\r\n#SigapMembangunNegeri\r\n#MengelolaAirUntukNegeri\r\n#Bwsk2MendukungZI\r\n#Bwsk2PkyC4ntik\r\n#UPIFEKAPUASBLOKA\r\n#BWSKALIMANTANII',NULL,'2023-08-28 14:02:04','2023-08-28 14:02:04'),(23,5,'video','Upacara Bendera HUT RI KE-78 Bersama UPT Kementerian PUPR di Provinsi Kalimantan Tengah','upacara-bendera-hut-ri-ke-78-bersama-upt-kementerian-pupr-di-provinsi-kalimantan-tengah-66552','ly1XxOXxldk','Halo #Pahari Kota C4ntik...\r\n\r\nKamis 17 Agustus 2023, BWS Kalimantan II Melaksanakan Upacara Bendera HUT RI KE-78 Bersama UPT Kementerian PUPR Yang terdapat di Provinsi Kalimantan Tengah. Di Laksanakan di Halaman kantor BPPW Kalimantan Tengah, Yang di ikuti oleh Segenap Pegawai dan Pejabat di lingkungan BWS Kalimantan II Palangka Raya, BPJN Kalteng , BPPW Kalteng, BP2JK Kalteng, dan Satker PERKIM Kalteng.\r\n\r\nMengutip Dari Pesan kemerdekaan\r\nMenteri PUPR\r\n\r\n\"Saya minta Para insan PUPR\r\nUntuk menanamkan karakter kuat, berani dan berjiwa seni. Kuat karena kompeten, berani karena berintegritas, berjiwa seni karena membutuhkan inovasi dan improvisasi dalam bekerja. Fighting spirit atau jiwa petarung yang tidak mudah menyerah menghadapi tantangan\r\nharus terus kita pupuk dan miliki.\r\n\r\nMarilah kita jadikan Peringatan HUT ke-78\r\nRepublik Indonesia ini sebagai momentum\r\nUntuk selalu memotivasi kita memperkuat memberikan yang terbaik yang kita bisa. Mari kita terus menjaga kekompakan\r\ndan kebersamaan untuk menuntaskan semua tugas yang diberikan.\r\nSemoga Allah SWT, Tuhan Yang Maha Kuasa senantiasa melindungi langkah\r\nkita menuntaskan tugas-tugas pembangunan infrastruktur. \"\r\n\r\nDirgahayu ke-78 Republik Indonesia,\r\nMerdeka..Merdeka..Merdeka..!\r\nDirgahayu Negeri Pancasila, Merdeka!!!\r\n\r\nWabillahi taufik walhidayah,\r\nWassalamu\'alaikum, wr. wb.\r\n\r\nJakarta, 17 Agustus 2023\r\nMENTERI PEKERJAAN UMUM DAN\r\nPERUMAHAN RAKYAT\r\nM. BASUKI HADIMULJONO\r\n\r\nDirgahayu Kemerdekaan Indonesia! Selamat merayakan 17 Agustus 2023!\r\n\r\nFacebook : Pupr Sda Bws Kalimantan II\r\nTwitter. : @Pupr_sda_bwsk2\r\nInstagram : @Pupr_Sda_Kalimantan2\r\nYoutube. : @Pupr_Sda_Kalimantan2\r\n\r\n#SigapMembangunNegeri\r\n#MengelolaAirUntukNegeri\r\n#Bwsk2MendukungZI\r\n#Bwsk2PkyC4ntik',NULL,'2023-08-28 14:03:16','2023-08-28 14:03:16'),(24,5,'video','Unit Pengelola Irigasi UPI Food Estate Kapuas Blok A BWS Kalimantan II Palangka Raya','unit-pengelola-irigasi-upi-food-estate-kapuas-blok-a-bws-kalimantan-ii-palangka-raya-10912','q_H2aCHzSy4','Halo #Pahari Kota C4ntik...\r\nUnit Pengelola Irigasi (UPI) merupakan suatu unit kerja yang bertanggung jawab terhadap pengelolaan sistem irigasi khususnya penyelenggaraan OP Irigasi dalam satu Daerah Irigasi Rawa (DIR) atau Daerah Irigasi (DI) yang membawahi minimal 2 (dua) UPTD/Kepengamatan dan dipimpin oleh seorang ketua UPI.\r\nUPI Food Estate Kapuas Blok A mencakup wilayah kerja seluas 43.503 Ha di 8 Daerah Irigasi Rawa (DIR) yaitu DIR Dadahup; DIR Handil Rakyat Palingkau; DIR Palingkau SP1, SP2, SP3; DIR Handil Rakyat Sei Tatas; DIR Handil Rakyat Kaladan Seberang; DIR Unit Tatas; DIR Unit Sakalagon; dan DIR Handil Rakyat Palingkau Seberang.\r\nUPI Food Estate Kapuas Blok A dibentuk untuk mendukung salah satu program Pemerintah Indonesia dalam rangka ketahanan pangan nasional yaitu Food Estate. UPI Food Estate Kapuas Blok A dibentuk pada bulan Juli 2022 dan dituangkan melalui Surat Keputusan Kepala Balai Wilayah Sungai Kalimantan II Nomor 104/KPTS-Bws14/2022.\r\n\r\nFacebook : Pupr Sda Bws Kalimantan II\r\nTwitter. : @Pupr_sda_bwsk2\r\nInstagram : @Pupr_Sda_Kalimantan2\r\nYoutube. : @Pupr_Sda_Kalimantan2\r\n\r\n#SigapMembangunNegeri\r\n#MengelolaAirUntukNegeri\r\n#Bwsk2MendukungZI\r\n#Bwsk2PkyC4ntik\r\n#UPIFEKAPUASBLOKA\r\n#UPIFEKAPUASBLOKAJAYAJAYAJAYA\r\n#BWSKALIMANTANII\r\n#EVKIN2023',NULL,'2023-08-28 14:31:58','2023-08-28 14:31:58'),(25,5,'video','UPI Food Estate Kegiatan Membantu Menyukseskan Panen Pertanian di (DIR) Blok A Kapuas','upi-food-estate-kegiatan-membantu-menyukseskan-panen-pertanian-di-dir-blok-a-kapuas-46832','9JbP6CGQ2dg','Unit Pengelola Irigasi (UPI) Food Estate Kapuas Blok A telah melakukan rangkaian kegiatan dalam rangka membantu menyukseskan panen pertanian baik tanaman padi, palawija, maupun jenis hortikultura di wilayah 8 Daerah Irigasi Rawa (DIR) Food Estate Blok A Kapuas.\r\n\r\nTahapan kegiatan pertanian meliputi kegiatan pengolahan lahan, persiapan benih dan penanaman, pemupukan tanaman, pemeliharaan tanaman, pengendalian Organisme Pengganggu Tanaman (OPT), serta panen.\r\n\r\nTahap akhir dari proses budi daya tanaman pertanian adalah panen. Pemanenan tanaman pertanian harus dilakukan pada waktu yang tepat agar kualitas hasil produk tanaman\r\npertanian juga optimal ketika dikonsumsi.\r\n\r\nKementerian Pekerjaan Umum dan Perumahan Rakyat (PUPR) melalui Balai Wilayah Sungai Kalimantan II menugaskan Unit Pengelola Irigasi Food Estate Kapuas Blok A untuk \r\nmelakukan koordinasi bersama dinas terkait seperti Balai Penyuluh Pertanian dan Pemerintahan Desa dalam hal mengatasi terjadinya kekeringan antisipasi terjadinya kegagalan panen seperti melalui kegiatan pengisian suplai air ke lahan pertanian dengan cara pompanisasi air disertai dengan \r\npemberian kapur untuk mengurangi tingkat keasaman pada tanah di lahan. Pengisian air \r\ndilakukan untuk menyukseskan program pertanian, dan lahan pertanian milik masyarakat agar tanaman dapat tumbuh dengan optimal, sehingga harapannya hasil panen dapat terjaga. \r\n\r\nAdapun kebakaran hutan dan lahan di wilayah FE Blok A Kapuas, terutama DIR Dadahup akhir-akhir ini semakin sering terjadi. Untuk memadamkan api Balai Wilayah Sungai \r\nKalimantan II melalui Unit Pengelola Irigasi Food Estate Kapuas Blok A selalu sigap membantu dalam hal seperti memfasilitasi pompa air untuk membantu pemadaman api, petugas yang selalu siap membantu melakukan pompanisasi, menyiagakan unit mobile pump untuk melakukan pompanisasi dalam skala besar, dan melakukan komunikasi kepada masyarakat tentang bahaya kebakaran hutan dan lahan.\r\n\r\n#UPIFEKAPUASBLOKA\r\n#UPIFEKAPUASBLOKAJAYAJAYAJAYA\r\n#BWSKALIMANTANII',NULL,'2023-09-05 16:18:37','2023-09-05 16:18:37'),(26,5,'video','Kegiatan Kunjungan DPD RI Atas Pelaksanaan UUD NO 18 Tahun 2012 Tentang Pangan di Kab. Pulang Pisau, Prov Kalteng','kegiatan-kunjungan-dpd-ri-atas-pelaksanaan-uud-no-18-tahun-2012-tentang-pangan-di-kab-pulang-pisau-prov-kalteng-10807','a055blfx_7s','Halo #Pahari Kota C4ntik...\r\n\r\nSenin 04 September 2023, Kepala BWS Kalimantan II Palangkaraya, Bupati Pulang Pisau dan Tim Komite II DPD RI melakukan peninjauan lapangan di Desa Sanggang Kec. Pandih Batu dan Desa Belanti Siam Kalimantan Tengah.\r\n\r\nKegiatan ini bertujuan untuk mengetahui informasi progres kegiatan pelaksanaan Food Estate Provinsi Kalimantan Tengah, serta mengidentifikasi permasalahan/hambatan di lapangan\r\n\r\nHadir dalam kegiatan tersebut Kepala Balai Wilayah Sungai Kalimantan II Palangka Raya, Bupati Pulang Pisau, Perwakilan Pemprov Kalteng, Kementerian Pertanian, Kementerian PUPR, Kementerian LHK, Kementerian ATR/BPN .\r\n\r\nFacebook : Pupr Sda Bws Kalimantan II\r\nTwitter. : @Pupr_sda_bwsk2\r\nInstagram : @Pupr_Sda_Kalimantan2\r\nYoutube. : @Pupr_Sda_Kalimantan2\r\n \r\n\r\n#SigapMembangunNegeri \r\n#MengelolaAirUntukNegeri\r\n#Bwsk2MendukungZI\r\n#Bwsk2PkyC4ntik',NULL,'2023-09-08 10:08:18','2023-09-08 10:37:49'),(27,2,'video','Kunjungan PLT Dirjen SDA Ir. Jarot Widyoko Sp-1 ke BWS Kalimantan II Palangkaraya','kunjungan-plt-dirjen-sda-ir-jarot-widyoko-sp-1-ke-bws-kalimantan-ii-palangkaraya-44437','Oj8C1WUyJr4','Halo #Pahari Kota C4ntik... \r\nJumat, 4 Agustus 2023. PLT Dirjen Sumber Daya Air Kementerian Pekerjaan umum dan Perumahan Rakyat bapak Ir. Jarot Widyoko Sp-1 Berkunjung ke Balai Wilayah Sungai Kalimantan II Palangka Raya. \r\n\r\nDalam Kunjungannya PLT Direktur Jendral Sumber Daya Air Ir. Jarot Widyoko, Sp-1 menyampaikan arahan \"saya mengingatkan seluruh satuan kerja untuk memperhatikan pekerjaan yang ditanganinya. Jangan sampai salah dalam mengambil keputusan\" kepada seluruh Pejabat Struktural, PPK dan seluruh Pegawai BWS Kalimantan II Palangkaraya agar ; \r\n1. Waspada tindak Pidana Korupsi; \r\n2. Progres Keuangan dan Fisik ditingkatkan dan segera ditermynkan apabila ada selisih; \r\n3. Untuk Jabatan Fungsional agar dievaluasi dan meningkatkan kinerja; \r\n4. Etos Kerja dengan meningkatkan Kedisplinan pegawai; \r\n5. Tetap menjaga tali silaturahmi, kekeluargaan dan kekompakan antar sesama. \r\nDalam kesempatan ini di hadiri oleh Kepala Balai, Pejabat Struktural, Pejabat fungsional, dan Pejabat Perbendeharaan di lingkungan BWS Kalimantan II Palangka Raya. \r\n\r\nFacebook : Pupr Sda Bws Kalimantan II \r\nTwitter. : @Pupr_sda_bwsk2 \r\nInstagram : @Pupr_Sda_Kalimantan2 \r\nYoutube. : @Pupr_Sda_Kalimantan2 \r\n\r\n#sigapmembangunnegeri \r\n#mengelolaairuntuknegeri \r\n#Bwsk2MendukungZI \r\n#Bwsk2PkyC4ntik',NULL,'2023-11-01 16:02:03','2023-11-01 16:02:03'),(28,2,'video','Kegiatan Koordinasi dan Pemantauan Lapangan Program Food Estate di DIR Dadahup Kalimantan Tengah','kegiatan-koordinasi-dan-pemantauan-lapangan-program-food-estate-di-dir-dadahup-kalimantan-tengah-60123','_nCbCfYyuc8','Halo #Pahari Kota C4ntik... \r\n\r\nKamis 21 September 2023, BWS Kalimantan II Palangka Raya, beserta Asdep PPKSE Kemenko Perekonomian melakukan Diskusi Rencana Persiapan Musim Tanam Oktober 2023- Maret 2024 di Daerah Irigasi Blok A 43rb Ha termasuk penentuan lokasi kegiatan, upaya penyelesaian isu, serta pembagian peran masing-masing K/L dan melakukan Pemantauan Lapangan Program Food Estate Bersama di DIR Dadahup, Kabupaten Kapuas.\r\n\r\nHadir dalam kegiatan tersebut Kepala Balai Wilayah Sungai Kalimantan II Palangka Raya, Asisten Deputi Prasarana dan Sarana Pangan Kemenko Perekonomian, Perwakilan Direktur Perluasan dan Perlindungan, Perwakilan Direktur Perluasan dan Perlindungan Lahan, Direktur Irigasi Rawa Kementerian PUPR, Perwakilan Direktur Pengembangan Kawasan Transmigrasi Kementerian Desa PDTT, Perwakilan Direktur Pertanian Prov Kalteng, Dinas Pertanian Kab Kapuas, Perwakilan Direktorat Manajemen Aset PT Rajawali Nusantara Indonesia dan Perwakilan Kelompok Tani Setempat .\r\n\r\nFacebook : Pupr Sda Bws Kalimantan II\r\nTwitter. : @Pupr_sda_bwsk2\r\nInstagram : @Pupr_Sda_Kalimantan2\r\nYoutube. : @Pupr_Sda_Kalimantan2',NULL,'2023-11-01 16:05:11','2023-11-01 16:05:11'),(29,5,'video','Hoist The Flag Hari Bakti PUPR ke-78 BWS Kalimantan II','hoist-the-flag-hari-bakti-pupr-ke-78-bws-kalimantan-ii-39875','7fY8GlbU2nM',NULL,NULL,'2024-01-12 17:06:20','2024-01-12 17:06:20');
