INSERT INTO `pages` VALUES (1,2,'Tentang Balai Wilayah Sungai Kalimantan II','tentang-balai-wilayah-sungai-kalimantan-ii','<p>&nbsp;</p><figure class=\"image image_resized\" style=\"width:73.69%;\"><img src=\"https://sda.pu.go.id/balai/bwskalimantan2/uploads/editor/dwy_rizky_armando_2287678_1694574304.JPG\"></figure><h4 style=\"text-align:justify;\"><strong>SEJARAH BALAI</strong></h4><p style=\"text-align:justify;\"><strong>Balai Wilayah Sungai Kalimantan II</strong> pada awalnya berdiri pada tahun 2016 dengan nama Balai Wilayah Sungai Kalimantan II Kuala Kapuas sesuai dengan Peraturan Menteri PUPR No.20/PRT/M/2016. Kemudian terjadi perubahan nomenklatur dari Balai Wilayah Sungai Kalimantan II Kuala Kapuas menjadi Balai Wilayah Sungai Kalimantan II Palangka Raya pada tahun 2020 berdasarkan Peraturan Menteri PUPR No. 26/PRT/M/2020 tentang Organisasi dan Tata Kerja Unit Pelaksana Teknis di Kementerian Pekerjaan Umum dan Perumahan Rakyat.&nbsp;<br><br>Balai Wilayah Sungai Kalimantan II Palangka Raya merupakan pecahan dari Balai Wilayah Sungai Kalimantan II Banjarmasin yang sekarang menjadi Balai Wilayah Sungai Kalimantan III Banjarmasin. Saat ini Balai Wilayah Sungai Kalimantan II Palangka Raya Berkantor di Jl. Tjilik Riwut No.Km. 3, RW.5, Palangka, Kec. Jekan Raya, Kota Palangka Raya, Kalimantan Tengah 73112.</p><p style=\"text-align:justify;\">Wilayah Kerja Balai Wilayah Sungai Kalimantan II Palangka Raya yaitu Wilayah Sungai Jelai-Kendawangan meliputi Kabupaten Kotawaringin Barat, Kabupaten Katingan, Kabupaten Lamandau, Kabupaten Sukamara, Kabupaten Ketapang, dan Wilayah Sungai Mentaya-Katingan meliputi Kabupaten Kotawaringin Timur, Kabupaten Katingan serta Wilayah Sungai Barito DAS Kapuas meliputi Kabupaten Kapuas, dan Kabupaten Pulang Pisau.</p><h4 style=\"text-align:justify;\"><strong>VISI:&nbsp;</strong></h4><p>“Terwujudnya penyelenggaraan pengelolaan dan pendayagunaan sumber daya air Wilayah Sungai Jelai – Kendawangan, WS Mentaya – Katingan dan WS Barito DAS Kapuas serta berperan aktif dalam upaya mensukseskan program ketahanan pangan nasional, sehingga dapat memberikan manfaat sebesar-besarnya untuk peningkatan kesejahteraan rakyat secara adil, merata, selaras, berkelanjutan dan berwawasan lingkungan”</p><h4 style=\"text-align:justify;\"><strong>MISI:</strong></h4><ol><li>Mewujudkan Konservasi Sumber Daya Air yang berkelanjutan;</li><li>Pendayagunaan Sumber Daya Air yang adil untuk pemenuhan berbagai kebutuhan masyarakat &nbsp;yang memenuhi syarat – syarat kualitas dan kuantitas;</li><li>Pengendalian Daya Rusak Air;</li><li>Pemberdayaan dan Peningkatan Partisipasi Masyarakat, Swasta dan Pemerintah dalam Pengelolaan dan Pembangunan Sumber Daya Air;&nbsp;</li><li>Peningkatan Keterbukaan dan Ketersediaan Data serta Informasi dalam Pembangunan Sumber Daya Air.</li></ol>',544,1,0,'2023-03-14 20:40:50','2023-11-01 17:15:56',NULL),(2,1,'coba','coba-diganti','<p>Ini halaman coba</p><figure class=\"image\"><img src=\"https://studio.pinandu.com/demo/bws/uploads/editor/super_admin_6002445_1678854536.png\"></figure>',0,1,1,'2023-03-14 21:20:57','2023-04-11 19:37:27','2023-04-11 19:37:27'),(3,1,'Ini test','ini-test-iii','<p>Ini adalah test</p>',0,1,1,'2023-03-14 21:21:46','2023-03-14 21:23:40','2023-03-14 21:23:40'),(4,2,'Tugas dan Fungsi','tugas-dan-fungsi','<h4><strong>TUGAS:&nbsp;</strong></h4><p>Berdasarkan Permen PUPR Nomor:16 Tahun 2020 Bws Kalimantan II Memiliki tugas<br>Melaksanakan pengelolaan sumber daya air di wilayah sungai yang &nbsp;meliputi penyusunan program, pelaksanaan konstruksi, operasi &nbsp;dan pemeliharaan dalam rangka konservasi dan pendayagunaan &nbsp;sumber daya air dan pengendalian daya rusak air pada sungai, &nbsp;pantai, bendungan, danau, situ, embung, dan tampungan air &nbsp;lainnya, irigasi, rawa, tambak, air tanah, dan air baku serta &nbsp;pengelolaan drainase utama perkotaan.&nbsp;<br>(Pasal 28)</p><h4><strong>FUNGSI :&nbsp;</strong></h4><p>Dalam melaksanakan tugas sebagaimana dimaksud dalam Pasal 28, Balai Wilayah Sungai menyelenggarakan fungsi: (Pasal 29)</p><ol><li>Penyusunan pola pengelolaan sumber daya air dan rencana pengelolaan sumber dayn air pada wilayah sungai;</li><li>Penyusunan program pengelolaan sumber daya air dan rencana kegintan pengelolaan sumber daya air pada wilayah sungai;</li><li>Pemantauan dan evaluasi penyelenggaraan atau penerapan pola pengelolaan sumber daya air dan rencana pengelolaan sumber daya air;</li><li>Penyusunan studi kelayakan dan perencanaan teknis, desain, dan pengembangan sumber daya air;</li><li>Pelaksanaan pengadaan barang dan jasa sesuai dengan ketentuan peraturan perundang-undangan;</li><li>Pelaksanaan penerapan sistem manajemen keselamatan dan kesehatan kerja;</li><li>Pengelolaan sumber daya air yang meliputi konservasi sumber daya air, pendayagunaan sumber daya air, dan pengendalian daya rusak air pada wilayah sungai;</li><li>Pengelolaan drainase utama perkotaan;</li><li>Pengelolaan sistem hidrologi;</li><li>Pengelolaan sistem informasi sumber daya air:</li><li>Pelaksanaan operasi dan pemeliharaan sumber daya air pada wilayah sungai;</li><li>Pelaksanaan pemberian bimbingan teknis pengelolaan sumber daya air yang menjadi kewenangan provinsi dan kabupaten/kota;</li><li>Penyusunan dan penyiapan rekomendasi teknis dalam pemberian izin penggunaan sumber daya air pada wilayah sungai;</li><li>Penyusunan saran teknis untuk pengalihan alur sungai dan pemanfaatan bekas sungai;</li><li>Penyusunan dan pelaksannan kajian penetapan garis sempandan sungai, garis sempadan danau, garis sempadan situ, dan garis sempadan jaringan irigasi;</li><li>Pemberdayaan masyarakat dalam pengelolaan sumber daya air;</li><li>Fasilitasi kegiatan tim koordinasi pengelolaan sumber daya air pada wilayah sungai;</li><li>Pelaksanaan penyusunan laporan akuntansi keuangan dan akuntansi barang milik negara selaku unit akuntansi wilayah;</li><li>Pelaksanaan pemungutan, penerimaan, dan penggunaan biaya jasa pengelolaan sumber daya air sesuai dengan ketentuan peraturan perundang-undangan:</li><li>Pelaksanaan urusan tata usaha dan rumah tangga Balai serta komunikasi publik;</li><li>Penyusunan perjanjian kinerja dan laporan kinerja Balai; dan</li><li>Pelaksanaan pemantauan dan pengawasan penggunaan sumber daya air dan penyidikan tindak pidana bidang sumber daya air.</li></ol>',150,1,0,'2023-04-11 19:39:52','2023-04-11 19:39:52',NULL),(5,2,'Informasi Pejabat','informasi-pejabat','<h4><strong>PROFIL KEPALA BALAI</strong></h4><figure class=\"table\" style=\"width:100%;\"><table class=\"ck-table-resized\"><colgroup><col style=\"width:17.18%;\"><col style=\"width:3.77%;\"><col style=\"width:79.05%;\"></colgroup><tbody><tr><td>NAMA</td><td>:</td><td><strong>Ferry Syahrizal, S.T.,M.T.</strong></td></tr><tr><td>TEMPAT, TANGGAL LAHIR</td><td>:</td><td><strong>Palembang, 20 Februari 1968</strong></td></tr><tr><td>JABATAN</td><td>:</td><td><strong>KEPALA BALAI WILAYAH SUNGAI KALIMANTAN II PALANGKA RAYA, BALAI WILAYAH SUNGAI ESELON III, DIREKTORAT JENDERAL SUMBER DAYA AIR.</strong></td></tr></tbody></table></figure>',222,1,0,'2023-04-11 19:45:40','2023-04-11 19:47:58',NULL),(6,2,'Informasi Kantor','informasi-kantor','<figure class=\"image\"><img src=\"https://sda.pu.go.id/balai/bwskalimantan2/uploads/editor/dwy_rizky_armando_7006327_1694575876.png\"><figcaption>&nbsp;</figcaption></figure><h4><strong>INFORMASI ALAMAT KANTOR</strong></h4><figure class=\"table\" style=\"width:100%;\"><table class=\"ck-table-resized\"><colgroup><col style=\"width:9.15%;\"><col style=\"width:3.77%;\"><col style=\"width:87.08%;\"></colgroup><tbody><tr><td>Alamat</td><td>:</td><td><strong>Jalan Tjilik Riwut No.Km.3,5 RW.5, Palangka, Kec. Jekan Raya, Kota Palangka Raya, Kalimantan Tengah 73112 &nbsp;</strong></td></tr></tbody></table></figure><figure class=\"media\"><oembed url=\"https://goo.gl/maps/mGDcNuUbXWGe5e4s8\"></oembed></figure><h4><br><strong>SOSIAL MEDIA</strong></h4><figure class=\"table\" style=\"width:100%;\"><table class=\"ck-table-resized\"><colgroup><col style=\"width:9.33%;\"><col style=\"width:3.77%;\"><col style=\"width:86.9%;\"></colgroup><tbody><tr><td>INSTAGRAM</td><td>:</td><td><strong>@Pupr_Sda_Kalimantan2</strong></td></tr><tr><td>FACEBOOK</td><td>:</td><td><strong>Pupr Sda Bws Kalimantan II</strong></td></tr><tr><td>TWITTER</td><td>:</td><td><strong>@pupr_sda_bwsk2</strong></td></tr><tr><td>YOUTUBE</td><td>:</td><td><strong>@Pupr_Sda_Kalimantan2</strong></td></tr></tbody></table></figure>',208,1,0,'2023-04-11 19:52:14','2023-09-13 11:35:22',NULL),(7,2,'Struktur Organisasi','struktur-organisasi','<figure class=\"image\"><img src=\"https://sda.pu.go.id/balai/bwskalimantan2/uploads/editor/dwy_rizky_armando_0055611_1693282274.png\"></figure>',485,1,0,'2023-05-04 13:42:01','2023-08-29 12:11:25',NULL),(8,2,'Coba Halaman','coba-halaman','<p>lorem ipsum….</p>',1,1,0,'2023-05-12 14:57:17','2023-05-12 15:04:19','2023-05-12 15:04:19'),(9,2,'Infografis Data Pegawai','infografis-data-pegawai','<figure class=\"image image_resized\" style=\"width:49.78%;\"><img src=\"https://sda.pu.go.id/balai/bwskalimantan2/uploads/editor/admin_2348902_1698831363.png\"></figure><p style=\"text-align:center;\"><img class=\"image_resized\" style=\"width:21.09%;\" src=\"https://sda.pu.go.id/balai/bwskalimantan2/uploads/editor/admin_7001484_1698830661.png\"><img class=\"image_resized\" style=\"width:34.25%;\" src=\"https://sda.pu.go.id/balai/bwskalimantan2/uploads/editor/admin_1504998_1698830688.png\">&nbsp;</p><p style=\"text-align:center;\"><img class=\"image_resized\" style=\"width:27.27%;\" src=\"https://sda.pu.go.id/balai/bwskalimantan2/uploads/editor/admin_0304564_1698830809.png\"><img class=\"image_resized\" style=\"width:32.75%;\" src=\"https://sda.pu.go.id/balai/bwskalimantan2/uploads/editor/admin_8891768_1698830834.png\"></p><p style=\"text-align:center;\">&nbsp;<img class=\"image_resized\" style=\"width:25.77%;\" src=\"https://sda.pu.go.id/balai/bwskalimantan2/uploads/editor/admin_9845952_1698830853.png\"> <img class=\"image_resized\" style=\"width:29.96%;\" src=\"https://sda.pu.go.id/balai/bwskalimantan2/uploads/editor/admin_4492256_1698830867.png\">&nbsp;</p><p style=\"text-align:center;\"><img class=\"image_resized\" style=\"width:31.34%;\" src=\"https://sda.pu.go.id/balai/bwskalimantan2/uploads/editor/admin_1868697_1698830889.png\"><img class=\"image_resized\" style=\"width:37.35%;\" src=\"https://sda.pu.go.id/balai/bwskalimantan2/uploads/editor/admin_1028510_1698830899.png\"></p>',111,1,0,'2023-11-01 14:32:13','2023-11-01 18:00:25',NULL);
