INSERT INTO `posts` VALUES (7,2,7,'Kegiatan Sekolah Sungai dalam Rangakaian Memperingati Hari Air Dunia ke-31 tahun 2023','kegiatan-sekolah-sungai-35808','kegiatan_sekolah_sungai_1681272601.png','<p>BWS Kalimantan II Palangkaraya melalui Satker OP SDA Kalimantan II pada tanggal 13 Maret 2023 dalam rangakaian memperingati Hari Air Dunia ke 31 tahun 2023, BWS Kalimantan II menyelenggarakan Kegiatan Sekolah Sungai ,kegiatan ini di buka oleh Kepala Seksi OP SDA BWS Kalimantan II Bpk. Agus. F Rottie, ST, MT dihadiri oleh Pejabat Struktural dan PPK serta Staf Satker OP SDA. Narasumber pada kegiatan ini yaitu Ibu Novrianti Veranica, ST, MT, Dosen Universitas Muhamadiyah Palangka Raya yang aktif pada kegiatan komunitas sosial dan Narasumber ibu Yustiningtyas, S.Hut ketua di Yayasan Borneo Nature Foundation, dan Peserta Kegiatan yang hadir berjumlah 60 orang yang berasal dari 10 SD di sekitar Kota Palangka Raya, Guru Pendamping, Mahasiswa Muhamadiyah Palangka Raya, dan Komunitas Trash Hero Palangka Raya, Di Sela kegiatan ini Kepala Balai Bpk. Ferry Syahrizal, ST, MT menyampaikan beberapa arahan pentingnya memelihara sungai dengan peran serta generasi muda, tujuan Kegiatan ini juga memberikan bekal pengetahuan dasar tentang pengelolaan sungai berkelanjutan berbasis komunitas/partisipasi masyarakat, dan mensinergikan antara stakeholder pengelola sungai, dari masyarakat, akademisi SD, SMP, Mahasiswa dan juga pemerintah.</p><p>Kegiatan Sekolah Sungai berlangsung selama 1 hari, selain edukasi di dalam kelas kegiatan ini juga di luar kelas, Adapun materi yang di berikan mengedukasi tentang pentingnya menjaga sungai di sekitar kita kemudian menumbuh kembangkan kecintaan akan kebersihan, kecintaan akan sungai, pentingnya membuang sampah, edukasi tentang pentinya daur ulang dan edukasi tentang sampah yang tidak gampang terurai oleh tanah.</p><p>Selengkapnya dapat disaksikan dichannel Youtube kita :<br><a href=\"https://www.youtube.com/watch?v=-ufZvOLsQ6I\">https://www.youtube.com/watch?v=-ufZvOLsQ6I</a></p><p>&nbsp;</p>','publish',72,5,2,1,'2023-04-11 21:10:01','2023-11-01 15:19:29'),(8,2,5,'Kegiatan Bersih Sungai Berlokasi di Saluran Drainase Bukit Keminting','hari-air-dunia-ke-31-tahun-2023-47840','hari_air_dunia_ke_31_tahun_2023_1681272715.png','<p>Dalam rangka memperingati Hari Air Sedunia atau “World Water Day”, Balai Wilayah Sungai (BWS) Kalimantan II bersama Binamarga, Cipta Karya, BP2JK, Universitas muhammadiyah Dinas terkait yang ada di Provinsi Kalimantan Tengah (Kalteng), Dinas terkait di Kota Palangka Raya, dan Komunitas Peduli Sungai mengadakan kegiatan Bersih Sungai. Kegiatan bersih-bersih sungai tersebut dilakukan di Saluran Air (Drainase Kota) sepanjang Jalan Bukit Keminting, Jumat (17/3/2023).</p><p>Kepala BWS Kalimantan II Ferry Syahrizal menjelaskan bahwa kegiatan ini dilakukan karena air ke depan banyak masalah, persoalan-persoalan air seperti banjir, kekurangan air dan air yang kotor (tidak layak konsumsi) serta perubahan iklim. Sehingga itu merupakan tantangan sumber daya air.</p><p>Maka dari itu, imbuh Ferry dalam momentum peringatan ke-31 hari air sedunia yang jatuh tanggal 22 Maret 2023 nanti mengusung tema “The Change Want You To See in the World”.<br>“Artinya apa, inti dari tema tersebut adalah mari kita berubah. Jadi, kalau kita tidak berubah kapan lagi, jadi perubahan tersebut agar mengatasi krisis air dan sanitasi,” jelasnya.</p>','publish',83,4,3,1,'2023-04-11 21:11:55','2023-05-17 20:53:09'),(9,2,4,'Rapat Dengar Pendapat dengan DPRD Kabupaten Katingan','bws-kalimantan-ii-melakukan-rapat-dengar-pendapat-dprd-kab-katingan-87045','bws_kalimantan_ii_melakukan_rapat_dengar_pendapat_dprd_kab_katingan_1681272978.png','<p>Kepala SNVT PJPA II Kalimantan II Yakubson, S.T., M.T., didampingi PPK Irwa II SNVT PJPA II Rohman, S.T., menyampaikan Program Pembangunan Strategic Irrigation Modernization and Urgent Rehabilitation Project (SIMURP) di Daerah Irigasi Rawa Katingan I Tahun Pelaksanaan 2022-2024, serta Dasar Hukum dan Dokumen Lingkungannya dalam rapat dengar pendapat yang dipimpin Ketua DPRD Katingan, di Gedung Paripurna, Kasongan, pada Rabu, 24 Maret 2023.</p><p>Rapat Dengar Pendapat bersama Balai Wilayah Sungai Kalimantan II yaitu diwakili SNVT PJPA II Kalimantan II Kementerian PUPR yang digelar DPRD Kabupaten Katingan ini juga turut dihadiri Asisten II Setda Kabupaten Katingan, Kepala Dinas PUPR Kabupaten Katingan, Kepala Dinas Pertanian Kabupaten Katingan, Kepala Dinas PTSP Kabupaten Katingan, Camat Katingan Kuala, dan PT. Pegatan Usaha Makmur, beserta jajarannya.</p><p>#sigapmembangunnegeri</p>','publish',96,3,1,1,'2023-04-11 21:16:19','2023-05-17 20:53:09'),(10,2,5,'Penanaman Biopori dan Pohon Di lingkungan BPPW Kalimantan Tengah Bersama PBJN, BPPW dan BP2JK','penanaman-biopori-dan-pohon-di-lingkungan-bppw-kalimantan-tengah-bersama-pbjn-bppw-dan-bp2jk-22678','penanaman_biopori_dan_pohon_di_lingkungan_bppw_kalimantan_tengah_bersama_pbjn_bppw_dan_bp2jk_1681274888.png','<p>Dalam Rangka Hari Air Dunia ke-31 Balai Wilayah Sungai Kalimantan II Palangka Raya melaksanakan Peringatan HARI AIR DUNIA ke-31 Tahun 2023.<br>Kegiatan Acara puncak Hari Air Dunia yang dibuka oleh Kepala BWS Kalimantan II, Ferry Syahrizal, ST.,MT setelah itu Penanaman Biopori dan Pohon Di lingkungan BPPW Kalimantan Tengah, dan di Lanjutkan dengan Fun Gateball antar UPT Kementerian PUPR di Kalimantan Tengah. BWS Kalimantan II dalam Penanaman Biopori telah mencapai 361 lubang dari Target 2924 Lubang, Penanaman Biopori tersebut berada di lingkungan BWS Kalimantan II, Kawasan Sekolah, dan Kawasan yang rawan terjadi genangan air.</p><p>Selengkapnya dapat disaksikan dichannel Youtube kita :<br><a href=\"https://www.youtube.com/watch?v=aCCmnm7Vh58\">https://www.youtube.com/watch?v=aCCmnm7Vh58</a></p><p>&nbsp;</p>','publish',98,6,1,1,'2023-04-11 21:48:09','2023-05-17 20:53:09'),(11,2,6,'Rencana Pembangunan Integrated Nursery Farming System, Upaya Mendukung Program Ketahanan Pangan','rencana-pembangunan-integrated-nursery-farming-system-upaya-mendukung-program-ketahanan-pangan-86585','rencana_pembangunan_integrated_nursery_farming_system_upaya_mendukung_program_ketahanan_pangan_1682397504.png','<p style=\"text-align:justify;\"><strong>Bengkulu</strong> – Kementerian Pekerjaan Umum dan Perumahan Rakyat (PUPR) melalui Direktorat Jenderal Sumber Daya Air (Ditjen SDA) yang diwakili Direktur Irigasi dan Rawa Ismail Widadi bersama dengan Kepala Balai Wilayah Sungai Sumatera VII Bengkulu Adi Umar Dani melakukan kunjungan lapangan ke Kabupaten Bengkulu Utara (14/3) terkait rencana pembangunan&nbsp;<i>Integrated Nursery Farming System&nbsp;</i>(INFS).&nbsp;</p><p style=\"text-align:justify;\">Hal ini dilakukan dalam rangka menindaklanjuti arahan Menteri PUPR untuk melakukan survey lapangan terhadap usulan dari Bupati Bengkulu Utara H. Mian.&nbsp;</p><p style=\"text-align:justify;\">Pembangunan&nbsp;<i>Integrated Nursery Farming System</i> ini kedepannya dapat meningkatkan produktivitas tanam untuk mendukung program pemerintah dalam mewujudkan ketahanan pangan, menghasilkan benih/bibit perkebunan, perikanan, peternakan yang bermutu serta sebagai&nbsp;<i>demfarm show window technology</i> yang bisa dijadikan lokasi agrowisata. Rencananya, pembangunan tersebut akan dilakukan pada lahan seluas 79,86 ha yang dimiliki oleh Pemerintah Daerah (Pemda) Kabupaten Bengkulu Utara.</p><p style=\"text-align:justify;\">“Beberapa hal penting yang menjadi perhatian rencana pembangunan&nbsp;<i>Integrated Nursery Farming System</i> diantaranya terkait kepastian status kepemilikan lahan, ketersediaan sumber air yang harus terukur, perlu adanya uji coba kesesuaian lahan untuk memastikan komoditas yang cocok pada lahan tersebut, dan perlu dilakukan analisa topografi dengan membentuk tim yang melibatkan BWS Sumatera VII Bengkulu, Pemda Kabupaten Bengkulu Utara serta Akademisi,” jelas Direktur Irigasi dan Rawa.</p><p style=\"text-align:justify;\">Keberlangsungan kegiatan ini diharapkan dapat meningkatkan kinerja dan menjadi wadah koordinasi pembangunan infrastruktur sumber daya air di Kabupaten Bengkulu Utara, serta menambah manfaat bagi masyarakat.</p><p style=\"text-align:justify;\">Sumber: <a href=\"https://sda.pu.go.id/berita/view/rencana_pembangunan_integrated_nursery_farming_system_upaya_mendukung_program_ketahanan_pangan\">https://sda.pu.go.id/berita/view/rencana_pembangunan_integrated_nursery_farming_system_upaya_mendukung_program_ketahanan_pangan</a></p>','publish',36,6,2,1,'2023-04-24 21:38:25','2023-05-17 20:53:09'),(13,2,6,'UN 2023 Water Conference di PBB: Indonesia Berkomitmen Penuhi Kebutuhan Air Bagi 275 Juta Penduduk Indonesia','un-2023-water-conference-di-pbb-indonesia-berkomitmen-penuhi-kebutuhan-air-bagi-275-juta-penduduk-indonesia-09530','un_2023_water_conference_di_pbb_indonesia_berkomitmen_penuhi_kebutuhan_air_bagi_275_juta_penduduk_indonesia_1682397845.png','<p><strong>New York </strong>-&nbsp;Pemerintah Indonesia menempatkan air sebagai prioritas utama dalam agenda pembangunan nasional guna memastikan akses air yang merata dan sanitasi yang layak bagi 275 juta penduduk Indonesia. Pemenuhan kebutuhan air sangatlah penting bagi pembangunan berkelanjutan khususnya demi mengatasi masalah kemiskinan dan krisis pangan sebagai komitmen Indonesia dalam Water Action Agenda 2023.</p><p>Perubahan iklim telah menyebabkan cuaca ekstrim, ketersediaan air yang tidak dapat diprediksi, memperburuk kelangkaan air, dan mencemari persediaan air. Tantangan-tantangan tersebut telah meningkatkan tekanan pada keberlangsungan sumber daya air dan ekosistem, termasuk risiko kekeringan dan banjir, yang telah menjadi perhatian global.</p><p>“Oleh karena itu, Indonesia berkomitmen untuk mencapai ketahanan air yang berkelanjutan dengan menerapkan adaptasi iklim dan Disaster Risk Reduction (DRR) dalam perencanaan pembangunan nasional,” kata Menteri Basuki selaku Ketua Delegasi Pemerintah Republik Indonesia (Delri) dalam Plenary Session UN 2023 Water Conference di New York, Amerika Serikat pada Kamis (23/3).</p><p>Menteri Basuki mengatakan, terdapat lima faktor lintas sektoral yang perlu diatasi demi mempercepat target ketahanan air yang berkelanjutan tersebut. Pertama yaitu pembiayaan melalui pendanaan tambahan untuk meningkatkan investasi konservasi air dan layanan ekosistem air.&nbsp;</p><p>“Kita harus mencari mekanisme pendanaan yang tidak konvensional untuk mempercepat pencapaian 100% akses sanitasi air, untuk menambahkan lebih banyak penyimpanan air, dan untuk memastikan langkah-langkah pencegahan bencana,” jelas Menteri Basuki.</p><p>Kemudian, kedua, diperlukan juga penguatan data dan informasi melalui penelitian dan knowledge sharing. Ketiga, pengembangan kapabilitas melalui peningkatan pelatihan dan pendidikan. Keempat, inovasi pengembangan penyediaan air bersih yang memadai bagi semua. Serta kelima, peningkatan peran tata kelola pemerintah dalam menyusun dan mengimplementasikan kebijakan air bersih pada tingkat nasional dan internasional.&nbsp;</p><p>“Water Conference ini harus mampu memperkuat komitmen global dalam mempercepat agenda terkait air. Komitmen ini juga harus tercermin dalam KTT SDG tahun ini, dan UN Summit of the Future tahun 2024. Kuncinya adalah bagaimana kita menerjemahkan komitmen ini ke dalam langkah dan tindak lanjut yang konkret demi kemajuan bersama,” tutur Menteri Basuki.&nbsp;</p><p>Sebagai tuan rumah World Water Forum ke-10 tahun 2024, Menteri Basuki menyampaikan bahwa Indonesia berkomitmen untuk melanjutkan semua hasil pembahasan pada UN 2023 Water Conference ini dan memastikan komitmen ini diterjemahkan ke dalam tindakan konkret. Dengan tema Water for Shared Prosperity, World Water Forum 2024 bertujuan untuk memperkuat kemitraan dan sinergi multi-stakeholder sektor air secara global.&nbsp;</p><p>“Mari kita bekerja sama meningkatkan komitmen yang berorientasi tindakan dalam mencapai target pemenuhan air demi masa depan kemanusiaan,“ tutup Menteri Basuki.&nbsp;</p>','publish',73,4,2,1,'2023-04-24 21:44:05','2023-05-17 20:53:09'),(14,2,6,'Menteri Basuki Gelar Rapat Koordinasi Bersama Menteri Pertanian, Upayakan Kesuksesan Program Food Estate','menteri-basuki-gelar-rapat-koordinasi-bersama-menteri-pertanian-upayakan-kesuksesan-program-food-estate-20970','menteri_basuki_gelar_rapat_koordinasi_bersama_menteri_pertanian_upayakan_kesuksesan_program_food_estate_1682474608.png','<p><strong>Jakarta</strong> - Sebagai bentuk dukungan dalam mensukseskan program&nbsp;food estate&nbsp;di sejumlah daerah yang diharapkan menjadi lumbung pangan baru di luar Pulau Jawa, Kementerian Pekerjaan Umum dan Perumahan Rakyat bersama dengan Kementerian Pertanian menggelar rapat koordinasi di Jakarta pada Rabu(5/4).</p><p>Rapat koordinasi kali ini dilakukan dengan tujuan untuk menyelaraskan dan meningkatkan koordinasi pelaksanaan program pengembangan&nbsp;food estate yang sudah dimulai di beberapa daerah di Indonesia.</p><p>Menteri Basuki menyampaikan, saat ini Kementerian PUPR telah melakukan pembangunan infrastruktur di Sumatera Utara, Kalimantan Tengah, Nusa Tenggara Timur (NTT), dan Papua untuk mendukung pengembangan&nbsp;food estate.</p><p>\"Untuk di Sumatera Utara di Kabupaten Humbang Hasundutan, pada saat ini infrastruktur air baku (jaringan perpipaan primer dan sekunder) telah tersedia untuk lahan 1.000 ha, yang sudah siap untuk ditanami seluas 119 ha. Dari 119 ha, lahan yang sudah dimanfaatkan seluas 41,8 ha diantaranya ditanami bawang merah, bawang putih, cabai, kubis, jagung dan kentang oleh masyarakat,\" kata Menteri Basuki.</p><p>Selain itu, Kementerian PUPR juga telah melakukan&nbsp;Land Clearing seluas 72 ha dari 200 ha yang telah direncanakan di kawasan Taman Sains dan Teknologi Herbal (TSTH). Serta juga telah dilakukan pembangunan Fasilitas TSTH, antara lain gedung riset, mess karyawan, screen house dan infrastruktur kawasan, dengan progres 97,5% dan target selesai akhir April 2023, serta pembangunan Jalan Akses TSTH sepanjang 14,3 km, jalan akses food estate 8 km dan 2 jembatan.</p><p>\"Kemudian&nbsp;food estate di Kalimantan Tengah. Pada tahun 2021 Pemerintah merencanakan pengembangan food estate seluas 43.000 ha. Kementerian PUPR telah mendukung penyediaan infrastruktur berupa jaringan irigasi rawa di Blok A seluas 43.000 ha,\" kata Menteri Basuki.</p><p>Menteri Basuki menjelaskan, penyediaan infrastruktur jaringan irigasi tersebut terdiri dari pekerjaan rehabilitasi dan peningkatan jaringan irigasi rawa sepanjang 2.195 km, pembangunan pintu dan jembatan sejumlah 178 unit pintu air dan 60 unit box culvert, dan pembangunan serta rehabilitasi Pintu Air DIR Dadahup Tahap 2 (SYC) berupa pembangunan 1 pintu air primer, pembangunan 4 pintu air tersier, pembangunan 9 box culvert dan rehabilitasi 3 pintu air primer.</p><p>\"Sedangkan untuk di NTT, pengembangan food estate terdapat di Kabupaten Belu, Sumba Tengah dan Sumba Timur. Di Kabupaten Belu, pemanfaatan air dari Bendungan Rotiklot seluas 55 ha, pemanfaatan air dari Bendungan Haliwen seluas 20 ha, dan dari Bendungan Haekrit seluas 60 ha. Juga ada pemanfaatan sumur air tanah sebanyak 23 lokasi untuk area seluas 230 ha,\" kata Menteri Basuki. (*)</p><p>Sedangkan untuk di Kabupaten Sumba Tengah NTT, Menteri Basuki menyebutkan telah dilakukan peningkatan Jaringan Irigasi Embung Lokojange dengan luas layanan 260 ha dan pemanfaatan air tanah lewat pembuatan sumur. \"Untuk di Sumba Timur, pengembangan lahan sorgum sangat didukung dengan ketersediaan air tanah yang banyak dan aktifnya petani, untuk itu salah satunya Kementerian PUPR bangun 4 titik sumur bor dan 50 titik sumur gali untuk melayani 389 ha lahan masyarakat di Desa Patawang,\" ujarnya.</p><p>Terakhir untuk food estate di Keerom, Papua, Menteri Basuki mengatakan, pada tahap pertama Kementerian PUPR mulai menyiapkan food estate di lahan eks-sawit seluas 3.000 ha. \"Sejauh ini sudah dilakukan olah tanah siap tanam seluas 500 ha, kalau ini dapat ditanami dengan baik baru dilanjutkan, karena ketersediaan airnya sangat cukup,\" kata Menteri Basuki.</p><p>Menteri Pertanian Syahrul Yasin Limpo menyampaikan terima kasih atas kerja sama Kementerian PUPR dan Kementerian Pertanian sejauh ini untuk pengembangan food estate di sejumlah daerah. \"Mungkin sistem pengairan ke depannya harus terus dibenahi, untuk air kami tetap berharap bantuan dari Kementerian PUPR dan kami siap mendukung,\" kata Menteri Pertanian.</p>','publish',69,5,1,1,'2023-04-26 03:03:28','2023-05-17 20:53:09'),(16,4,7,'UPACARA BENDERA HUT RI KE-78','upacara-bendera-hut-ri-ke-78-87030','upacara_bendera_hut_ri_ke_78_1692340927.png','<p>Kamis 17 Agustus 2023, BWS Kalimantan II Melaksanakan Upacara Bendera HUT RI KE-78 Bersama UPT Kementerian PUPR Yang terdapat di Provinsi Kalimantan Tengah. Di Laksanakan di Halaman kantor BPPW Kalimantan Tengah, Yang di ikuti oleh Segenap Pegawai dan Pejabat di lingkungan BWS Kalimantan II Palangka Raya, BPJN Kalteng , BPPW Kalteng, BP2JK Kalteng, dan Satker PERKIM Kalteng.&nbsp;</p><p>Mengutip Dari Pesan kemerdekaan Menteri PUPR \"Saya minta Para insan PUPR Untuk menanamkan karakter kuat, berani dan berjiwa seni. Kuat karena kompeten, berani karena berintegritas, berjiwa seni karena membutuhkan inovasi dan improvisasi dalam bekerja. Fighting spirit atau jiwa petarung yang tidak mudah menyerah menghadapi tantangan harus terus kita pupuk dan miliki. Marilah kita jadikan Peringatan HUT ke-78 Republik Indonesia ini sebagai momentum Untuk selalu memotivasi kita memperkuat memberikan yang terbaik yang kita bisa. Mari kita terus menjaga kekompakan dan kebersamaan untuk menuntaskan semua tugas yang diberikan. Semoga Allah SWT, Tuhan Yang Maha Kuasa senantiasa melindungi langkah kita menuntaskan tugas-tugas pembangunan infrastruktur. \" Dirgahayu ke-78 Republik Indonesia, Merdeka..Merdeka..Merdeka..! Dirgahayu Negeri Pancasila, Merdeka!!! Wabillahi taufik walhidayah, Wassalamu\'alaikum, wr. wb.&nbsp;</p><p>Jakarta, 17 Agustus 2023 MENTERI PEKERJAAN UMUM DAN PERUMAHAN RAKYAT M. BASUKI HADIMULJONO&nbsp;</p><p>Dirgahayu Kemerdekaan Indonesia! Selamat merayakan 17 Agustus 2023!</p>','publish',72,4,2,1,'2023-08-18 14:42:08','2023-08-18 14:42:08'),(17,4,8,'WORLD WATER FORUM','world-water-forum-55683','world_water_forum_1697161861.png','<p>Setelah kemarin bersama Watermin menyaksikan pembukaan 2nd Stakeholders Consultation Meeting (SCM), yuk, kita cari tahu tujuan dan hasil yang diharapkan dari pelaksanaan acara ini.</p><p>2nd SCM diagendakan menjadi wadah bagi para pemangku kepentingan untuk mendiskusikan dan merancang ide-ide dan aksi nyata mengenai pengelolaan air, yang dibagi kedalam tiga segmen, yaitu politik, tematik, dan regional.</p><p>Serangkaian tujuan dan hasil dari 2nd SCM diharapkan dapat memperkuat komitmen global untuk membangun strategi komprehensif dalam menjawab tantangan air.</p><p>Mari bersatu dan berkolaborasi demi mewujudkan tujuan “Air untuk Kemakmuran Bersama”!</p><p>&nbsp;</p><p>Silakan kunjungi laman<a href=\"http://www.worldwaterforum.org\">&nbsp;www.worldwaterforum.org</a> untuk informasi lebih lanjut!</p><p>&nbsp;</p><p>#SigapMembangunNegeri<br>#MengelolaAirUntukNegeri</p><p>#10thWorldWaterForum</p><p>#WaterForSharedProsperity</p>','publish',30,5,1,1,'2023-10-13 09:51:01','2023-11-01 14:45:10'),(18,4,6,'BATIK SDA 2023: Upaya Pencegahan Korupsi di Kalangan Generasi Muda SDA','batik-sda-2023-upaya-pencegahan-korupsi-di-kalangan-generasi-muda-sda-74837','batik_sda_2023_upaya_pencegahan_korupsi_di_kalangan_generasi_muda_sda_1697419309.png','<p>&nbsp;</p><p>Dalam upaya pencegahan korupsi di lingkungan Direktorat Jenderal Sumber Daya Air (Ditjen SDA) bekerjasama dengan Komisi Pemberantasan Korupsi(KPK) dalam melakukan sosialisasi anti korupsi yang merupakan agenda rutin tahunan.</p><p>&nbsp;</p><p>Tahun ini, Direktorat Kepatuhan Intern mengadakan kegiatan “BATIK SDA (Bicara Anti Korupsi Insan SDA) Edisi Generasi Muda di Lingkungan Direktorat Jenderal Sumber Daya Air” sebagai langkah pencegahan tindak korupsi serta membangun budaya anti korupsi di kalangan generasi muda SDA.</p><p>&nbsp;</p><p>Berdasarkan Survei Penilaian Integritas(SPI) yang diadakan setiap tahunnya, Ditjen SDA masih memerlukan langkah strategis untuk perbaikan integritas kedepannya. Berbagai langkah perbaikan pun terus dilakukan guna membangun sistem kerja yang kondusif .</p><p>&nbsp;</p><p>Oleh karena itu, beberapa upaya telah dilakukan antara lain melalui Penerapan Kepatuhan Intern, Manajemen Risiko, Sistem Pengendalian Intern Pemerintah (SPIP), Pembangunan Zona Integritas (ZI), dan Penerapan Sistem Manajemen Anti Penyuapan (SMAP) yang terus didorong implementasinya pada seluruh Unit Kerja dan Unit Pelaksana Teknis (UPT). Sehingga, diharapkan dapat membantu mengakselerasi perbaikan tata kelola dan integritas pegawai.</p><p>&nbsp;</p><p>Saat ini Direktorat Jenderal Sumber Daya Air memiliki jumlah generasi muda berusia dibawah 35 tahun berjumlah 1.056 PNS atau sekitar 15,4% dari total jumlah PNS dan sekitar 8,96% dari total jumlah pegawai, baik PNS maupun NRP. Dengan mengundang perwakilan generasi muda SDA dari seluruh Unit Kerja/UPT seIndonesia, diharapkan nantinya peserta kegiatan pada hari ini akan menjadi agen-agen internalisasi antikorupsi di unit masing-masing.&nbsp;</p><p>&nbsp;</p><p>Hal ini dapat menjadi tantangan sekaligus peluang, karena para generasi muda ini akan menjadi pimpinan masa depan yang melanjutkan strategi perbaikan integritas ke depan. Dalam kegiatan ini, pembekalan pada Generasi Muda diawali dengan diskusi internal mengenai mitigasi risiko pekerjaan konstruksi sebagai wujud penerapan nilai antikorupsi “Jumat Bersepeda KK”, yaitu Jujur, Mandiri, Tanggung Jawab, Berani, Sederhana, Peduli, Disiplin, Adil, dan Kerja Keras.&nbsp;</p><p>&nbsp;</p><p>Selain itu, kegiatan ini turut mengundang para stakeholder eksternal pada 10 UPT Penerapan SMAP untuk turut menyaksikan penandatanganan komitmen kebijakan anti penyuapan sekaligus penyebarluasan progres penerapan SMAP di Direktorat Jenderal Sumber Daya Air. (fif)</p>','publish',56,6,1,1,'2023-10-16 09:21:49','2023-10-16 09:21:49'),(19,4,6,'Politik, Kesejahteraan, Budaya, Bencana; Semua Berkaitan Dengan Air','politik-kesejahteraan-budaya-bencana-semua-berkaitan-dengan-air-88127','politik_kesejahteraan_budaya_bencana_semua_berkaitan_dengan_air_1697419406.png','<p>Bali – 12 Oktober 2023 – Para <i>keynote speech </i>dalam pembukaan acara Stakeholders Consultation Meeting (SCM) ke-2 meyampaikan secara terpisah bahwa aspek-aspek dalam kehidupan manusia sangat berkaitan dengan air. Mereka adalah Presiden World Water Council Loïc Fauchon, Menteri PUPR Basuki Hadimuljono, Pejabat Gubernur Bali Sang Made Mahendra Jaya, dan Kepala BMKG Dwikorita Karnawati.</p><p>Loïc Fauchon mengatakan SCM ke-2 berfungsi salah satunya sebagai “Water Deal”, sebuah komitmen bersama yang menyerukan diplomasi air secara berkesinambungan untuk meyakinkan para pemimpin dunia dan pemimpin politik bahwa “air adalah isu politik” dan sekarang adalah saatnya akselerasi dalam kesepakatan tentang air.</p><p>“Kita perlu memandang air sebagai isu politik. Sudut pandang ini menyiratkan hubungan baru antara manusia dan air yang tidak terlepas dari kebijakan para pemimpin negara,” jelas Loïc. Selain itu, Loïc juga menyebutkan beberapa prioritas dalam mengatasi krisis air global termasuk di antaranya menciptakan keseimbangan baru antara air untuk manusia dan alam, termasuk keseimbangan antara akses air perkotaan dan perdesaan, air untuk pertanian dan irigasi untuk menjamin produksi pangan, dan pengelolaan sumber daya air terpadu untuk menjamin pembangunan berkelanjutan.</p><p>Menteri PUPR Basuki Hadimuljono selaku Ketua Harian pada Panitia Nasional 10th World Water Forum (WWF) pada kesempatan ini membahas mengenai “Water Justice” dari sisi pemerataan akses terhadap air secara global. “Kita akan membahas <i>water justice</i>, termasuk di dalamnya pengelolaan air di pulau-pulau kecil dan akses air bersih untuk semua,” sebut Menteri PUPR.</p><p>Basuki juga mengatakan bahwa SCM ke-2 memainkan peran penting dalam meletakkan dasar bagi 10th World Water Forum tahun depan. Hasil diskusi di antara para pemangku kepentingan dari forum ini akan dielaborasi melalui proses tematik, regional, dan politik dengan keterkaitan dan keterpaduan antar sub-tema.</p><p>“Kemudian, kami akan memetakan keterkaitan antar sub-tema, wilayah, dan ketiga proses tersebut untuk dirancang sebagai hasil akhir forum dan rencana tindak lanjut. Hasil dari forum ini akan menjadi dasar pelaksanaan WWF tahun depan,” jelas Basuki.</p><p>Pejabat Gubernur Bali Sang Made Mahendra Jaya mengatakan bahwa Bali adalah wujud nyata harmonisasi antara air, kehidupan masyarakat dan budaya. Hal ini tercermin dari pemanfaatan air untuk pertanian. Bali memiliki sistem pengelolaan irigasi berdasarkan prinsip-prinsip keagamaan sosial-agraria yang sudah ada sejak zaman dahulu. Sistem ini dikenal luas oleh dunia dengan sebutan Subak.</p><p>Meskipun Subak telah terbukti sebagai pengelolaan irigasi yang baik, namun tidak dapat dipungkiri bahwa teknologi dan inovasi diperlukan untuk meningkatkan efektifitas Subak. “Saya berharap forum ini tidak hanya berfungsi untuk memfasilitasi pertukaran pengetahuan tetapi juga untuk meningkatkan teknologi inovatif khususnya dalam sistem irigasi Subak guna menjamin ketahanan air dan pangan global,” imbuh Pejabar Gubernur Bali.</p><p>Kepala Badan Meteorologi, Klimatologi dan Geofisika Dwikorita Karnawati memaparkan bahwa dampak dari perubahan iklim tampak jelas pada kondisi air. Tidak hanya pada ketersediaannya, namun juga pada bencana yang mengiringinya. Misalnya saja fenomena El Nino yang menyebabkan kekeringan di sejumlah wilayah.</p><p>Dampak iklim pada kondisi air ini akan berpengaruh juga pada keberlanjutan ekosistem dan masyarakat dari berbagai sisi. Oleh karena itu, SCM ke-2 ini memiliki peran besar untuk menentukan dasar pembahasan 10th WWF yang harapannya dapat melahirkan solusi bersama yang berlaku global untuk berbagai masalah air di dunia.</p><p>SCM ke-2 diselenggarakan di Bali, 12-13 Oktober 2023, merupakan rangkaian acara menjelang World Water Forum ke-10 yang akan berlangsung bulan Mei 2024. Acara ini diikuti oleh 1.094 peserta terdaftar, dengan rincian 254 peserta berasal dari mitra internasional dan 840 peserta berasal dari mitra Nasional.</p><p>Mitra Internasional yang berasal dari 73 negara akan bekerja sesuai sub-tema: Ketahanan dan Kesejahteraan Air, Air untuk Manusia dan Alam, Pengurangan dan Manajemen Risiko Bencana, Tata Kelola, Kerjasama dan Diplomasi Air, Pembiayaan Air Berkelanjutan, dan terakhir, Pengetahuan dan Inovasi.</p><p>Turut hadir dalam gelaran Opening Ceremony Stakeholders Consultation Meeting (SCM) ke-2, yakni Direktur Jenderal IKP KOMINFO Usman Kansong, Perwakilan dari Kementerian Lingkungan Hidup dan Kehutanan, Perwakilan dari Kemenko Bidang Kemaritiman dan Investasi, serta sejumlah organisasi internasional.</p><p>(Kompu SDA – kty, fif, man)</p>','publish',73,6,2,1,'2023-10-16 09:23:26','2023-10-16 09:23:26'),(20,4,7,'STUDI BANDING TIM SEKRETARIAT TKPSDA WS.MENTAYA-KATINGAN DAN WS. JELAI-KENDAWANGAN KEPADA TIM SEKRETARIAT TKPSDA WS. JRATUNSELUNA','studi-banding-tim-sekretariat-tkpsda-wsmentaya-katingan-dan-ws-jelai-kendawangan-kepada-tim-sekretariat-tkpsda-ws-jratunseluna-29011','studi_banding_tim_sekretariat_tkpsda_wsmentaya_katingan_dan_ws_jelai_kendawangan_kepada_tim_sekretariat_tkpsda_ws_jratunseluna_1698716628.png','<p>Kamis, 28 Oktober 2023 Sekretariat TKPSDA WS. Mentaya-Katingan dan WS. Jelai-Kendawangan di BWS Kalimantan II melaksanakan kegiatan studi banding ke Sekretariat TKPSDA WS. Jratunseluna di BBWS Pemali Juana.&nbsp;<br>kegiatan ini dihadiri oleh Kepala Seksi KPISDA Diana Eka Sintha dan Ketua Sekretariat Prawita Sari beserta jajaran anggota sekretariat. Yang diterima langsung oleh Ketua TKPSDA WS. Jratunseluna Nathan Setyawan, Kepala Bidang OP BBWS Pemali Juana Andri Rachmanto Wibowo dan anggota Sekretatiat TKPSDA WS. Jrarunseluna.<br>Pada kegiatan ini dilakukan sharing terkait pelaksanaan TKPSDA khususnya dalam penguatan sekretariat untuk menunjang pengelolaan sumber daya air di masing-masing wilayah sungai. Selain itu dilakukan sharing terkait Pembangunan Zona Integritas dan Pelayanan Rekomtek pada BBWS Pemali Juana.<br>Kegiatan dilanjutkan dengan kunjungan ke Ruang Unit Layanan Terpadu, Unit Center BBWS Pemali Juana dan diakhiri dengan kunjungan lapangan ke Sungai Bringin Kota Semarang terkait sharing pelaksanaan Rekomendasi tindaklanjut hasil TKPSDA berupa normalisasi sungai di lokasi&nbsp;tersebut.</p>','publish',38,4,1,1,'2023-10-31 10:07:32','2023-10-31 10:07:32'),(21,5,7,'HARI SUMPAH PEMUDA KE-95 \"BERSAMA MAJUKAN INDONESIA\"','hari-sumpah-pemuda-ke-95-bersama-majukan-indonesia-95933','hari_sumpah_pemuda_ke_95_bersama_majukan_indonesia_1698732985.png','<p>Dalam rangka memperingati Hari Sumpah Pemuda ke-95 yang mengusung tema “Bersama Majukan Indonesia,” Balai Wilayah Sungai Kalimantan II Palangka Raya melaksanakan upacara pada Sabtu (28/10/2023) yang dilaksanakan di Lapangan BWS Kalimantan II Palangkaraya.</p><p>Upacara tersebut &nbsp;dihadiri oleh Pejabat dan seluruh Pegawai BWS Kalimantan II di Lingkungan Halaman Kantor BWS Kalimantan II Palangkaraya.</p><p>Bertindak sebagai inspektur upacara &nbsp;tersebut Kepala Balai Wilayah Sungai Kalimantan II, Ferry Syahrizal S.T.,M.T.</p><p>Dalam kata sambutan Kepala Balai Wilayah Sungai Kalimantan II, Ferry Syahrizal S.T.,M.T&nbsp;mengatakan, momentum Sumpah Pemuda mengingatkan bangsa Indonesia terhadap sejarah gotong royong kenegaraan.</p><p>“Seluruh elemen pemuda berhasil menebar semangat jiwa patriotisme sekaligus menyatukan visi kebangsaan dalam Sumpah Pemuda 1928 yang melahirkan sebuah komitmen kebangsaan yaitu bertumpah darah satu tanah air Indonesia, berbangsa satu bangsa Indonesia, dan menjunjung bahasa persatuan bahasa Indonesia,”</p><p>Peringatan Hari Sumpah Pemuda ke-95 Tahun 2023 mengusung tema \"Bersama Majukan Indonesia\" bermakna membentuk instilasi barisan manusia yang menyimbolkan kolaborasi dan warna-warni menunjukkan keanekaragaman suku Bahasa dan budaya.</p><p>Marilah kita jadikan momentum peringatan Hari Sumpah Pemuda ke-95 ini sebagai momentum membangkitkan semangat kolaborasi dalam memajukan negeri,”</p><p>Selamat Hari Sumpah Pemuda yang ke-95!</p>','publish',87,5,2,1,'2023-10-31 14:16:25','2023-10-31 14:16:25'),(22,2,8,'Kementerian PUPR Targetkan Penyelesaian Bendungan Margatiga di Lampung Pada 2024','kementerian-pupr-targetkan-penyelesaian-bendungan-margatiga-di-lampung-pada-2024-63016','kementerian_pupr_targetkan_penyelesaian_bendungan_margatiga_di_lampung_pada_2024_1698821598.png','<p>Lampung - Kementerian Pekerjaan Umum dan Perumahan Rakyat (PUPR) melalui Balai Besar Wilayah Sungai (BBWS) Mesuji Sekampung, Direktorat Jenderal Sumber Daya Air tengah mempercepat penyelesaian Bendungan Margatiga yang berada di Kabupaten Lampung Timur, Provinsi Lampung. Bendungan yang mulai dibangun pada tahun 2017 ini, diproyeksikan akan meningkatkan jumlah tampungan air dan mendukung lumbung pangan nasional di Provinsi Lampung.<br><br>Dalam kunjungannya beberapa waktu lalu ke Provinsi Lampung, Presiden Jokowi mengatakan, Sebagai salah satu Proyek Strategis Nasional (PSN), Bendungan Margatiga ini ditargetkan segera selesai sehingga manfaatnya dapat dirasakan oleh masyarakat.<br><br>“Untuk Bendungan Margatiga, semakin cepat selesai akan semakin baik. Saya ingin tahun depan sudah rampung, tapi memang masih ada sedikit persoalan di lapangan. Jadi tunggu kami selesaikan terlebih dahulu,” ujar Presiden Jokowi.<br><br>Menteri PUPR Basuki Hadimuljono mengatakan, pembangunan bendungan bertujuan untuk peningkatan volume tampungan air sehingga suplai air irigasi ke lahan pertanian terus terjaga, penyediaan air baku dan pengendalian banjir.<br><br>\"Pembangunan bendungan akan diikuti dengan pembangunan jaringan irigasinya, sehingga dengan adanya suplai air yang kontinu dari bendungan, petani yang sebelumnya hanya satu kali tanam setahun, bisa bertambah menjadi 2-3 kali tanam,\"&nbsp; kata Menteri Basuki.<br><br>Bendungan Margatiga memiliki kapasitas tampung sebesar 42,31 juta m3 dengan luas genangan 2.217 Ha dan tinggi bendungan 22,5 m. Adapun konstruksinya dilaksanakan oleh PT Waskita Karya – PT Adhi Karya (KSO) dengan total anggaran sebesar Rp850 M.<br><br>\"Manfaatnya untuk pengairan Daerah Irigasi (DI) di Provinsi Lampung seluas 16.588 Ha, yakni DI Jabung kiri seluas 5.638 Ha dan potensi DI Jabung kanan seluas 10.950 Ha. Selain itu juga akan menambah pasokan air baku sebesar 0,8 m3/ detik untuk Kabupaten Lampung Timur,” jelas Kepala BBWS Mesuji Sekampung Roy Panagom Pardede.<br><br>Bendungan dengan konstruksi tipe urugan yang memiliki tinggi panjang puncak 321,76 meter, dan lebar puncak 7 meter ini juga diproyeksikan dapat mereduksi banjir sebesar 83,10 m3/detik untuk sebagian wilayah di Bandar Lampung dan Lampung Timur. Serta, memiliki fungsi lain sebagai konservasi air, penggelontoran air yang mencegah air asin, dan potensi pariwisata. (May)</p><p><a href=\"https://pu.go.id/berita/kementerian-pupr-targetkan-penyelesaian-bendungan-margatiga-di-lampung-pada-2024\">https://pu.go.id/berita/kementerian-pupr-targetkan-penyelesaian-bendungan-margatiga-di-lampung-pada-2024</a></p>','publish',56,6,2,1,'2023-11-01 14:53:18','2023-11-01 14:53:18'),(23,2,7,'Studi Banding Monitoring dan Evaluasi Kegiatan TP-OP di BBWS Brantas','studi-banding-monitoring-dan-evaluasi-kegiatan-tp-op-di-bbws-brantas-85965','studi_banding_monitoring_dan_evaluasi_kegiatan_tp_op_di_bbws_brantas_1699241432.png','<p>Kamis, 02 November 2023 Satuan Kerja Operasi dan Pemeliharaan SDA Melalui PPK OPSDA II BWS Kalimantan II melaksanakan kegiatan Studi Banding terkait Kegiatan TP-OP ke Bidang Operasi dan Pemeliharaan SDA Balai Besar Wilayah Sungai Brantas di Kota Surabaya.</p><p>Kegiatan ini dihadiri oleh Kepala Balai Wilayah Sungai Kalimantan II Bapak Ferry Syahrizal, Kepala Seksi Pelaksanaan Bapak Nopriyandi Muttaqien, Kepala Seksi Operasi dan Pemeliharaan SDA Ibu Prawita Sari serta Jajaran Pejabat Inti Satuan Kerja Operasi dan Pemeliharaan beserta Staff PPK OPSDA II &nbsp;Yang diterima langsung oleh Kepala Bidang Operasi dan Pemeliharaan BBWS Brantas Bapak &nbsp;I Ketut Karihartha dan Kepala Bidang KPISDA BBWS Brantas serta jajaran Pejabat Inti Satuan Kerja Operasi dan Pemeliharaan BBWS Brantas.</p><figure class=\"image\"><img src=\"https://sda.pu.go.id/balai/bwskalimantan2/uploads/editor/admin_p_7068855_1699241374.png\"></figure><figure class=\"image\"><img src=\"https://sda.pu.go.id/balai/bwskalimantan2/uploads/editor/admin_p_1311769_1699241377.png\"></figure><figure class=\"image\"><img src=\"https://sda.pu.go.id/balai/bwskalimantan2/uploads/editor/admin_p_0595421_1699241401.png\"></figure><p>Pada kegiatan ini dilakukan sharing terkait pelaksanaan Monitoring dan Evaluasi kegiatan TP-OP oleh SKPD TP-OP Provinsi Jawa Timur oleh BBWS Brantas dengan menggunakan inovasi yang memanfaatkan teknologi untuk memudahkan proses monitoring dan evaluasi terkait pekerjaan yang dilakukan oleh SKPD TP-OP Provinsi Jawa Timur.</p><p style=\"text-align:center;\">&nbsp;</p><p><br>Facebook : Pupr Sda Bws Kalimantan II<br>Twitter. : @Pupr_sda_bwsk2<br>Instagram : @Pupr_Sda_Kalimantan2<br>Youtube. : @Pupr_Sda_Kalimantan2</p><p>#SigapMembangunNegeri<br>#MengelolaAirUntukNegeri<br>#Bwsk2MendukungZI<br>#Bwsk2PkyC4ntik</p>','publish',129,6,2,1,'2023-11-06 11:23:36','2023-11-06 11:30:32'),(24,4,1,'PEMERIKSAAN  PAKET PEMBANGUNAN DAN REHABILITASI  PINTU AIR  DIR. DADAHUP TAHAP 2','pemeriksaan-paket-pembangunan-dan-rehabilitasi-pintu-air-dir-dadahup-tahap-2-79830','pemeriksaan_paket_pembangunan_dan_rehabilitasi_pintu_air_dir_dadahup_tahap_2_1699241637.png','<p>Kamis, 2 November 2023. BWS Kalimantan II Palangka Raya melalui SNVT PJPA I Melaksanakan kunjungan Lapangan Dalam Rangka Pemeriksaan Bersama Paket Pekerjaan Pembangunan Dan Rehabilitasi Pintu Air DIR. Dadahup Tahap II di Kabupaten Kuala Kapuas.<br>Dalam kunjungan ini ditinjau langsung oleh Kepala Seksi KPISDA, Diana Eka Sintha, S.T., M.T didampingi Kepala SNVT PJPA I Firmelin, S.T., M.Si dan Jajaran.</p><p><img src=\"https://sda.pu.go.id/balai/bwskalimantan2/uploads/editor/admin_p_7726068_1699241634.png\"><img src=\"https://sda.pu.go.id/balai/bwskalimantan2/uploads/editor/admin_p_5891270_1699241634.png\"><img src=\"https://sda.pu.go.id/balai/bwskalimantan2/uploads/editor/admin_p_2345057_1699241633.png\"><img src=\"https://sda.pu.go.id/balai/bwskalimantan2/uploads/editor/admin_p_4041973_1699241633.png\"><img src=\"https://sda.pu.go.id/balai/bwskalimantan2/uploads/editor/admin_p_0945806_1699241632.png\"><img src=\"https://sda.pu.go.id/balai/bwskalimantan2/uploads/editor/admin_p_7784856_1699241631.png\"><img src=\"https://sda.pu.go.id/balai/bwskalimantan2/uploads/editor/admin_p_9827859_1699241633.png\"><img src=\"https://sda.pu.go.id/balai/bwskalimantan2/uploads/editor/admin_p_7873896_1699241634.png\"><br><br>Facebook : Pupr Sda Bws Kalimantan II<br>Twitter. : <a href=\"https://www.instagram.com/Pupr_sda_bwsk2/\">@Pupr_sda_bwsk2</a><br>Instagram : <a href=\"https://www.instagram.com/Pupr_Sda_Kalimantan2/\">@Pupr_Sda_Kalimantan2</a><br>Youtube. : <a href=\"https://www.instagram.com/Pupr_Sda_Kalimantan2/\">@Pupr_Sda_Kalimantan2</a><br><br><a href=\"https://www.instagram.com/explore/tags/sigapmembangunnegeri/\">#SigapMembangunNegeri</a><br><a href=\"https://www.instagram.com/explore/tags/mengelolaairuntuknegeri/\">#MengelolaAirUntukNegeri</a><br><a href=\"https://www.instagram.com/explore/tags/bwsk2mendukungzi/\">#Bwsk2MendukungZI</a><br><a href=\"https://www.instagram.com/explore/tags/bwsk2pkyc4ntik/\">#Bwsk2PkyC4ntik</a></p>','publish',60,6,3,1,'2023-11-06 11:33:58','2023-11-06 11:33:58'),(26,4,7,'Pembahasan Laporan Self Assessment (SA) River Basin Organization Performance Benchmarking (RBO-PB) T.A. 2023','pembahasan-laporan-self-assessment-sa-river-basin-organization-performance-benchmarking-rbo-pb-ta-2023-24480','pembahasan_laporan_self_assessment_sa_river_basin_organization_performance_benchmarking_rbo_pb_ta_2023_1699329642.png','<p>Senin, 6 November 2023. BWS Kalimantan II Palangka Raya melakukan Pembahasan Laporan Self Assessment (SA) River Basin Organization Performance Benchmarking (RBO-PB) T.A. 2023 di Hotel Aquarius Palangka Raya Kegiatan ini diikuti oleh Tim Self Assessment dan Tim Pendukung Self Assessment River Basin Organization Performance Benchmarking (RBO-PB). Bertindak sebagai narasumber adalah Ir. Ketut Artana, M.Si dan perwakilan dari Direktoran Bina OP Pradita Setyaningrum, S.T.&nbsp;</p><p><br>Maksud dan Tujuan kegiatan ini adalah melakukan finalisasi laporan Self Assessment (SA) River Basin Organization Performance Benchmarking (RBO-PB) T.A. 2023 sehingga hasil penilaian mandiri yang sudah dilakukan sudah mengakomodir seluruh kegiatan yang telah di kerjakan BWS Kalimantan II. Hasil Laporan yang sudah di periksa bersama akan dilakukan review oleh Pembina pada tanggal 21-24 November untuk menentukan Indeks River Basin Organization Performance Benchmarking (RBO-PB) pada BWS&nbsp;Kalimantan&nbsp;II.</p><p>&nbsp;</p><figure class=\"image\"><img></figure><figure class=\"image\"><img></figure><figure class=\"image\"><img></figure><figure class=\"image\"><img></figure><p>Facebook : Pupr Sda Bws Kalimantan II<br>Twitter. : @Pupr_sda_bwsk2<br>Instagram : @Pupr_Sda_Kalimantan2<br>Youtube. : @Pupr_Sda_Kalimantan2</p><p>#SigapMembangunNegeri<br>#MengelolaAirUntukNegeri<br>#Bwsk2MendukungZI<br>#Bwsk2PkyC4ntik</p>','publish',50,6,2,1,'2023-11-07 12:00:43','2023-11-07 12:00:43'),(27,5,6,'SEMINAR NASIONAL BENDUNGAN BESAR KNI-BB 2023','seminar-nasional-bendungan-besar-kni-bb-2023-76354','seminar_nasional_bendungan_besar_kni_bb_2023_1702626499.png','<p>Pada tanggal 8-9 Desember 2023 BWS Kalimantan II Palangka Raya mengikuti kegiatan Seminar Nasional Bendungan Besar dan Rapat Anggota Tahunan Komite Nasional Indonesia untuk Bendungan Besar 2023 di Universitas Pelita Harapan, Tangerang, Banten dengan tema “Keamanan Bendungan dalam Menghadapi beban Ekstrim dan Perubahan Iklim”.</p><p><br>Seminar Nasional yang dihadiri oleh peserta sebanyak 712 peserta ini membahas beberapa isu penting, diantaranya adalah:<br>1. Bendungan Beserta Waduknya yang Beradaptasi Terhadap Perubahan Iklim;<br>2. Tantangan Pembangunan Bendungan dan Tanggul di Masa Depan;<br>3. Keamanan Bendungan dan Tanggul dalam Menghadapi Cuaca Ekstrim;<br>4. Keamanan Bendungan terhadap Gempa;<br>5. Meningkatkan Peran Bendungan Beserta Waduknya dalam Mendukung Energi Baru dan Energi Terbarukan.</p><p><br>Menteri PUPR Basuki Hadimuljono mengatakan, Indonesia telah membangun 61 bendungan dalam 10 tahun terakhir. Ia harap ke depan bisa terus dilanjutkan dengan membangun 50 bendungan baru setiap 5 tahun. \"Indonesia butuh banyak tambahan tampungan air lagi untuk menghadapi cuaca ekstrem dan perubahan iklim. Tidak ada pilihan lain untuk mengatasi banjir dan kekeringan, kecuali dengan menambah bendungan dan embung lebih banyak lagi,\" tambah Menteri Basuki.</p><p>Selain itu, \"Kita harus terus menjaga intellectual exercise kita dalam membangun dan mengelola bendungan. Jika selama ini kita membangun bendungan dengan tipe yang sama, rockfill dam, maka ke depannya kita perlu inovasi agar teknologi bendungan kita bisa lebih baik dan maju,\" kata Menteri Basuki.</p><p>Sekretaris Direktorat Jenderal Sumber Daya Air Kementerian PUPR Airlangga Mardjono selaku Ketua Umum KNI-BB mengatakan, Seminar Nasional Bendungan Besar 2023 mengangkat tema “Keamanan Bendungan dalam Menghadapi Beban Ekstrim dan Perubahan Iklim”.</p><p>\"Topik ini sangat relevan mengingat perubahan iklim, fenomena cuaca ekstrim dan aspek kebencanaan lainnya telah menjadi tantangan global bagi pembangunan dan pengelolaan infrastruktur di dunia,\" katanya.</p><p><br>Forum Seminar Nasional Bendungan Besar ini diharapkan bisa menjadi wadah bukan hanya untuk para ahli dan senior, tetapi juga dapat melibatkan generasi muda. Bendungan sebagai salah satu tampungan air di Indonesia merupakan objek vital nasional yang memiliki potensi resiko terhadap perubahan iklim. Selayaknya kita jaga bersama demi keberlanjutan ketahanan air.</p>','publish',50,6,2,1,'2023-12-15 15:48:20','2023-12-15 15:48:20'),(28,2,1,'Kunjungan Kerja Dari PT. MOYA INDONESIA dan PT. WITTEVEEN BOS INDONESIA di DIR DADAHUP','kunjungan-kerja-dari-pt-moya-indonesia-dan-pt-witteveen-bos-indonesia-di-dir-dadahup-97646','kunjungan_kerja_dari_pt_moya_indonesia_dan_pt_witteveen_bos_indonesia_di_dir_dadahup_1706509898.png','<p>Selasa, 23 Januari 2024, Balai Wilayah Sungai Kalimantan II menerima kunjungan kerja dari PT. Moya Indonesia dan PT. Witteveen Bos Indonesia di DIR Dadahup dengan didampingi oleh Pelaksanaan Urusan Pembinaan dan Pemantauan II Subdit Wilayah I, Dit. Irigasi dan Rawa, Harold Laski, S.T., M.Eng.&nbsp;</p><p>Kegiatan ini dipimpin oleh Kepala BWS Kalimantan II, Pak Ferry Syahrizal, dengan didampingi oleh Kepala Seksi Pelaksanaan, Kepala SNVT PJPA I, Kepala Satker OP, PPK Irigasi Rawa I,&nbsp;dan&nbsp;PPK&nbsp;OP&nbsp;I. Adapun pembahasan rapat tersebut membahas persoalan terkait pemaparan persiapan DIR Dadahup dalam kerjasama dengan PT Salim Group.</p><p>Dalam menjalin kerjasama dalam pengelolaan DIR Dadahup, Pihak Kementerian PUPR melalui Balai Wilayah Sungai Kalimantan II telah bersedia membantu untuk pengaturan sistem tata air sebagai suplai air untuk kebutuhan pertanian. Untuk Pengelolaan Sistem Tata Air, BWS Kalimantan II telah membentuk Unit Pengelola Irigasi (UPI), agar kebutuhan air dapat terpenuhi baik secara kuantitas maupun kualitas. Pihak Pertanian dapat memberikan advis teknis dalam penentuan masa tanam, pengolahan lahan, dan varietas padi yang cocok</p><p>&nbsp;</p><p>Facebook : Pupr Sda Bws Kalimantan II<br>Twitter. : @Pupr_sda_bwsk2<br>Instagram : @Pupr_Sda_Kalimantan2<br>Youtube. : @Pupr_Sda_Kalimantan2</p><p>#SigapMembangunNegeri<br>#MengelolaAirUntukNegeri<br>#Bwsk2MendukungZI<br>#Bwsk2PkyC4ntik</p>','publish',12,6,3,1,'2024-01-29 14:31:39','2024-01-29 14:31:39'),(29,2,7,'Bws Kalimantan II Palangka Raya Melaksanakan Apel Pagi Rutin','apel-pagi-73803','apel_pagi_1706596753.png','<p style=\"text-align:justify;\"><strong>BWS KALIMANTAN II PALANGKA RAYA</strong> - Senin, 29 Januari 2024. Balai Wilayah Sungai Kalimantan II Palangka Raya melaksanakan Apel Pagi rutin di Halaman Kantor BWS Kalimantan ll Palangka Raya. Kegiatan ini di ikuti oleh pejabat struktural dan fungsional serta karyawan karyawati di lingkungan BWS Kalimantan Il Palangka Raya. Bertindak sebagai Pembina Apel Pagi, Kepala Seksi Operasional dan Pemeliharaan BWS Kalimantan II Prawita Sari S.T.,M.T.<br><br>Dalam arahan Pembina Apel bahwa untuk tingkat curah hujan pada wilayah Kalimantan Tengah didominasi pada kategori curah hujan tinggi yang di prediksi pada bulan Januari hingga Februari. Dengan hal ini ia memberikan himbauan untuk selalu waspada munculnya banjir yang dinilai tidak menentu.</p><figure class=\"image image_resized\" style=\"width:67.83%;\"><img src=\"https://sda.pu.go.id/balai/bwskalimantan2/uploads/editor/admin_0280691_1706596641.png\"></figure><figure class=\"image image_resized\" style=\"width:67.95%;\"><img src=\"https://sda.pu.go.id/balai/bwskalimantan2/uploads/editor/admin_6610600_1706596633.png\"></figure><figure class=\"image image_resized\" style=\"width:67.34%;\"><img src=\"https://sda.pu.go.id/balai/bwskalimantan2/uploads/editor/admin_9096358_1706596635.png\"></figure><p style=\"text-align:justify;\">Facebook : Pupr Sda Bws Kalimantan II<br>Twitter. : <a href=\"https://www.instagram.com/Pupr_sda_bwsk2/\">@Pupr_sda_bwsk2</a><br>Instagram : <a href=\"https://www.instagram.com/Pupr_Sda_Kalimantan2/\">@Pupr_Sda_Kalimantan2</a><br>Youtube. : <a href=\"https://www.instagram.com/Pupr_Sda_Kalimantan2/\">@Pupr_Sda_Kalimantan2</a><br><br><a href=\"https://www.instagram.com/explore/tags/sigapmembangunnegeri/\">#SigapMembangunNegeri</a><br><a href=\"https://www.instagram.com/explore/tags/mengelolaairuntuknegeri/\">#MengelolaAirUntukNegeri</a><br><a href=\"https://www.instagram.com/explore/tags/bwsk2mendukungzi/\">#Bwsk2MendukungZI</a><br><a href=\"https://www.instagram.com/explore/tags/bwsk2pkyc4ntik/\">#Bwsk2PkyC4ntik</a></p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p>','publish',8,6,2,1,'2024-01-30 14:39:13','2024-01-30 14:54:38'),(30,2,7,'BWS Kalimantan II Palangka Raya Melaksanakan Rapat Monitoring dan Evaluasi Persiapan Pelaksanaan Tahun Anggaran 2024','bws-kalimantan-ii-palangka-raya-melaksanakan-rapat-monitoring-dan-evaluasi-persiapan-pelaksanaan-tahun-anggaran-2024-65016','bws_kalimantan_ii_palangka_raya_melaksanakan_rapat_monitoring_dan_evaluasi_persiapan_pelaksanaan_tahun_anggaran_2024_1706767926.png','<p>Rabu, 31 Januari 2024, BWS Kalimantan II Palangka Raya, Melaksanakan Rapat Monitoring dan Evaluasi, dibuka oleh Kepala Balai Wilayah Sungai Kalimantan II Bapak Ferry Syahrizal, S.T., M.T.</p><p>Adapun Outline Pembahasan Rapat Membahas :</p><ol><li>Progres Pelaksanaan Pekerjaan,&nbsp;</li><li>Persiapan menyambut T.A. 2024,&nbsp;</li><li>Progres Pelaksanaan Lelang Dini T.A. 2024 dan&nbsp;</li><li>Peningkatan Integritas pada Lingkungan Kerja BWS Kalimantan II</li></ol><p>Adapun yang Hadir dalam Rapat Monitoring dan Evaluasi yaitu Kepala Balai BWS Kalimantan II, Pejabat Struktural, Kasatker, PPK, Koortek, Koordam, Bendahara, PPSPM, Peltek dan Peldam di Lingkungan BWS Kalimantan II.</p><p>Facebook : Pupr Sda Bws Kalimantan II<br>Twitter. : @Pupr_sda_bwsk2<br>Instagram : @Pupr_Sda_Kalimantan2<br>Youtube. : @Pupr_Sda_Kalimantan2</p><p>#SigapMembangunNegeri<br>#MengelolaAirUntukNegeri<br>#Bwsk2MendukungZI<br>#Bwsk2PkyC4ntik</p>','publish',6,6,4,1,'2024-02-01 14:12:06','2024-02-01 14:12:06'),(32,2,7,'TANAM POHON Dalam Rangka Memperingati HUT Ke 43 Himpunan Ahli Teknik Hidraulik Indonesia (HATHI)','tanam-pohon-dalam-rangka-memperingati-hut-ke-43-himpunan-ahli-teknik-hidraulik-indonesia-hathi-27335','tanam_pohon_dalam_rangka_memperingati_hut_ke_43_himpunan_ahli_teknik_hidraulik_indonesia_hathi_1707119030.png','<p>Halo #Pahari Kota C4ntik...</p><p>Jumat, 02 Februari 2024. Balai Wilayah Sungai Kalimantan II Palangka Raya mengikuti Tanam Pohon Dalam Rangka Memperingati HUT ke-43 Himpunan Ahli Teknik Hidraulik Indonesia (HATHI) yang berlokasi di Drainase Lingkar Luar Kota Sampit, Kabupaten Kotawaringin Timur. Kegiatan ini di hadiri oleh Bupati Kotawaringin Timur, Wakil Bupati Kotawaringin Timur, Kepala Balai Wilayah Sungai Kalimantan II, Dinas Terkait, Himpunan Hathi dan Masyarakat Setempat.</p><figure class=\"image image_resized\" style=\"width:37.37%;\"><img src=\"https://sda.pu.go.id/balai/bwskalimantan2/uploads/editor/admin_1796114_1707117228.png\"></figure><figure class=\"image image_resized\" style=\"width:37.71%;\"><img src=\"https://sda.pu.go.id/balai/bwskalimantan2/uploads/editor/admin_6016136_1707117259.png\"></figure><p>Jenis Pohon yang ditanam yaitu Pohon Palem. Pohon Palem memiliki peran yang sangat penting. Tumbuhan ini mampu&nbsp;menyerap polusi sehingga dapat meningkatkan kualitas udara di sekitarnya. Selain itu dapat menyerap air 10 persen lebih banyak dibandingkan dengan tumbuhan lain.</p><p>Facebook : Pupr Sda Bws Kalimantan II<br>Twitter. : @Pupr_sda_bwsk2<br>Instagram : @Pupr_Sda_Kalimantan2<br>Youtube. : @Pupr_Sda_Kalimantan2</p><p>#SigapMembangunNegeri<br>#MengelolaAirUntukNegeri<br>#Bwsk2MendukungZI<br>#Bwsk2PkyC4ntik</p>','publish',5,6,5,1,'2024-02-05 15:43:51','2024-02-05 15:43:51'),(33,2,7,'Pembina Apel tegaskan terkait kedisplinan dalam melaksanakan Apel Pagi Rutin','pembina-apel-tegaskan-terkait-kedisplinan-dalam-melaksanakan-apel-pagi-rutin-18291','pembina_apel_tegaskan_terkait_kedisplinan_dalam_melaksanakan_apel_pagi_rutin_1707120270.png','<p>Halo #Pahari Kota C4ntik...</p><p>Senin, 05 Februari 2024. Balai Wilayah Sungai Kalimantan II Palangka Raya melaksanakan Apel Pagi rutin di Halaman Kantor BWS Kalimantan ll Palangka Raya. Kegiatan ini di ikuti oleh pejabat struktural dan fungsional serta karyawan karyawati di lingkungan BWS Kalimantan Il Palangka Raya. Bertindak sebagai Pembina Apel Pagi, Kepala Seksi Keterpaduan Pembangunan Infrastruktur SDA BWS Kalimantan II, Ibu Diana Eka Sintha, S.T.,M.T.</p><p>Dalam arahan Pembina Apel tegaskan terkait kedisplinan dan tetap dipertahankan dalam melaksanakan apel pagi rutin. Ia juga menyampaikan terkait Singkronisasi usulan Renstra untuk 2025-2029 dengan usulan program dari &nbsp;tahun 2020-2024 yang &nbsp;bergeser ke 2025-2029 dan juga ada beberapa usulan tambahan yang merupakan hasil kegiatan renstra yang sudah dilakukan di Tahun 2024. Kemudian beliau juga mengingatkan untuk Generasi Muda agar lebih berkompeten, berintegritas dan berjiwa seni.</p><p>Facebook : Pupr Sda Bws Kalimantan II<br>Twitter. : @Pupr_sda_bwsk2<br>Instagram : @Pupr_Sda_Kalimantan2<br>Youtube. : @Pupr_Sda_Kalimantan2</p><p>#SigapMembangunNegeri<br>#MengelolaAirUntukNegeri<br>#Bwsk2MendukungZI<br>#Bwsk2PkyC4ntik</p>','publish',2,6,2,1,'2024-02-05 16:04:31','2024-02-05 16:04:31');
